import React, { Component } from 'react'

class Post extends Component {
    render(){
        const { event } = this.props;
        return(
            <div className="card">
                .card-body
            </div>
        )
    }
}

export default class Event extends Component {
    render() {
        const { events } = this.props;
        return (
           <div>
                {events.map((event,i) => 
                    <Post key={event.eventDate} event={event} />
                )}
           </div>
        )
    }
}
